#include<iostream>
#include<time.h>

using namespace std;

void Print(int* arr, int size) {
    for (int i = 0; i < size; i++) {
        cout << arr[i] << " ";
    }
    cout << endl;
}

void Fill(int* arr, int size) {
    for (int i = 0; i < size; i++) {
        arr[i] = rand() % 10;
    }
}

int main() {

    setlocale(LC_ALL, "ru");

    srand(time(NULL));

    int size1, size2;

    cout << "Введите размер первого массива: ";
    cin >> size1;

    cout << "Введите размер второго массива: ";
    cin >> size2;

    int* arr1 = new int[size1];

    Fill(arr1, size1);
    Print(arr1, size1);

    int* arr2 = new int[size2];

    Fill(arr2, size2);
    Print(arr2, size2);

    int* temp = new int[size1];
    int count = 0;
    bool original = true;

    for (int i = 0; i < size1; i++) {
        for (int j = 0; j < size2; j++) {
            if (arr1[i] == arr2[j]) {
                original = false;
                break;
            }
        }
        for (int j = 0; j < count; j++) {
            if (arr1[i] == temp[j]) {
                original = false;
                break;
            }
        }
        if (original) {
            temp[count] = arr1[i];
            count++;
        }
        original = true;
    }

    int size3 = count;
    int* arr3 = new int[count];

    for (int i = 0; i < count; i++) {
        arr3[i] = temp[i];
    }
    delete[] temp;

    Print(arr3, size3);

    delete[] arr1;
    delete[] arr2;
    delete[] arr3;
}

